import Link from 'next/link';

type ListingViewProps = {
  title: string;
  id: string;
  type: 'job' | 'article'
}

export const ListingView = ({ title, id, type }: ListingViewProps) => (
  <li>
    <Link href={`/${type}s/[id]`} as={`/${type}s/${id}`}>
      <a>{title}</a>
    </Link>
  </li>
)

export default ListingView
